iterations.yara_rule:
rule Bypass_Evasion_Patterns {
    meta:
        description = "Evasion bypass detection using specific instruction sequences"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 EA 0F 84 33 FD FF FF FF E0 20 E8 CE CA FC }
        $pattern1 = { 85 C0 EA 74 85 F0 FF E0 4C E8 CE CA FC }
        $pattern2 = { 85 C0 EA 5A EB 8B EC EC 0F 84 33 FD FF FF FF E0 20 E8 CE CA FC }

    condition:
        any_of them
}

